const applyRubberBand = (x: number, edge: number, dimension: number) => {
  const c = 0.55 // 你可以调整这个值来改变橡皮筋的紧度
  return (
    (1.0 - 1.0 / ((Math.abs(x - edge) * c) / dimension + 1.0)) *
      dimension *
      Math.sign(x - edge) +
    edge
  )
}

